import React from 'react';
import styled from 'styled-components';
import logo from '../images/yugiohlogo.svg';

function Logo() {

    return (
        <StyledImage>
            <img src={logo} alt='logo' />
        </StyledImage>
    )
}

const StyledImage = styled.div`
    height: 75px;
    width: 100px;
    min-height: 50px;
    min-width: 75px;
`;

export default Logo;
